import requests
import json

def read_json(file_path):
    with open(file_path, "r") as f:
        return json.load(f)

config = read_json("config.json")

# base64 = ""

key = config["key"]

def solve_captcha(str):
  r = requests.post('http://2captcha.com/in.php', json={
    "key": key,
    "method": "rotatecaptcha",
    "angle": 60,
    "body": str,
    "json": 1,
    "soft_id": 2974
  })

  id = json.loads(r.text)["request"]

  sleep(10)
  url = 'http://2captcha.com/res.php?key=' + key + '&action=get&id=' + id + '&json=1'
  r = requests.get(url)

  result = json.loads(r.text)

  while(result["request"] == "CAPCHA_NOT_READY"):
    sleep(10)
    r = requests.get(url)
    result = json.loads(r.text)

  if(result["status"] == 1):
    return result["request"]

  print("retrying")
  return solve_captcha(str)


